import styled from "styled-components";

const PesquisaContainer = styled.div`
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 20px;
`;
function Pesquisa() {
    return (
        <PesquisaContainer>
            <h2>Já sabe por onde começar?</h2>
            <h3>Encontre seu livro em nossa estante.</h3>
            <Input type="text" placeholder="Pesquisar" />
        </PesquisaContainer>
    )
}
